from llom import LLM

# Agente 1: Classificador (Análise estratégica)
def solve_problem(problem_data):
    classifier = LLM(
        model="ollama:gemma3:4b",
        temperature=0.5,
        response_format={"problem_type": "string", "approach": "string"}
    )
    problem_type = classifier.predict(
        f"Classifique o problema e sugira abordagem: {problem_data['description']}"
    )

    # Agente 2: Restrições & Casos de Borda
    context_agent = LLM(
        model="ollama:gemma3:4b",
        temperature=0.4,
        response_format={"constraints": "list", "edge_cases": "list"}
    )
    context_data = context_agent.predict(
        f"Restrições e casos de borda para {problem_type['problem_type']} com abordagem {problem_type['approach']}"
    )

    # Agente 3: Gerador de Código Ótimo
    code_generator = LLM(
        model="ollama:qwen3:32b",
        temperature=0.15,
        response_format={"code": "string"}
    )
    code_prompt = f"Código Python para {problem_type['problem_type']}\nAbordagem: {problem_type['approach']}\nRestrições: {context_data['constraints']}\nCasos de borda: {context_data['edge_cases']}\nRequisitos: Código otimizado, tratamento explícito de todos os casos"
    final_code = code_generator.predict(code_prompt)

    return {
        "solution": final_code['code'],
        "problem_type": problem_type['problem_type'],
        "constraints": context_data['constraints']
    }

from llm_agent import LLM_Agent

def solve_problem(problem_data):
    # Agente de análise combinada
    analyzer = LLM_Agent(
        role="Problem Analyst",
        instruction="Identifique: 1) Tipo de problema (algoritmo, DP, etc) e abordagem recomendada; 2) 3 restrições mais importantes; 3) 5 casos de borda críticos",
        arquitetura_resposta={"problem_type": "string", "approach": "string", "constraints": "list", "edge_cases": "list"},
        model="ollama:gemma3:4b",
        temperatura=0.5
    )
    analysis = analyzer.generate_response(problem_data)

    # Gerador de código otimizado
    code_generator = LLM_Agent(
        role="Precision Code Generator",
        instruction=f"Implemente código Python com base no contexto:
Tipo: {analysis['problem_type']}
Abordagem: {analysis['approach']}
Restrições: {analysis['constraints']}
Casos de borda: {analysis['edge_cases']}
Requisitos: Código otimizado, tratamento explícito de todos os casos, comentários claros",
        arquitetura_resposta={"code": "string"},
        model="ollama:qwen3:32b",
        temperatura=0.15,
        arquitetura_respostas_anteriores=[analysis]
    )
    return code_generator.generate_response(problem_data)
